(3, 'Invoice:Invoice Created', 1, '{{business_name}} Invoice', '\nInvoice URL: {{invoice_url}}\nInvoice ID: {{invoice_id}}\nInvoice Amount: {{invoice_amount}}\nDue Date: {{invoice_due_date}}', 'Yes', 'Yes', 0),
(7, 'Admin:Password Change Request', 1, '{{business_name}} password change request', 'Click this linke to reset your password- {{password_reset_link}}Best Regards,{{business_name}} Team', 'Yes', 'Yes', 0),
(10, 'Admin:New Password', 1, '{{business_name}} New Password for Admin', 'Hello {{name}}Here is your new password for{{business_name}}. \nLog in URL: {{login_url}}\nUsername: {{username}}\nPassword: {{password}}\n', 'Yes', 'Yes', 0),
(12, 'Invoice:Invoice Payment Reminder', 1, '{{business_name}} Invoice Payment Reminder', 'Greetings,This is a billing reminder that your invoice no. {{invoice_id}} which was generated on {{invoice_date}} is due on {{invoice_due_date}}.\nInvoice URL: {{invoice_url}}\nInvoice ID: {{invoice_id}}\nInvoice Amount:{{invoice_amount}}\nDue Date: {{invoice_due_date}}\n', 'Yes', 'Yes', 0),
(13, 'Invoice:Invoice Overdue Notice', 1, '{{business_name}} Invoice Overdue Notice', 'Greetings,This is the notice that your invoice no. {{invoice_id}} which was generated on {{invoice_date}} is now overdue\nInvoice URL: {{invoice_url}}\nInvoice ID: {{invoice_id}}\nInvoice Amount:{{invoice_amount}}\nDue Date: {{invoice_due_date}}', 'Yes', 'Yes', 0),
(14, 'Invoice:Invoice Payment Confirmation', 1, '{{business_name}} Invoice Payment Confirmation', 'Greetings,This is a payment receipt for Invoice {{invoice_id}} sent on {{invoice_date}}.Login to your client Portal to view this invoice.\nInvoice URL: {{invoice_url}}\nInvoice ID: {{invoice_id}}Invoice Amount: {{invoice_amount}}\nDue Date: {{invoice_due_date}}', 'Yes', 'Yes', 0),
(15, 'Invoice:Invoice Refund Confirmation', 1, '{{business_name}} Invoice Refund Confirmation', 'Greetings,This is confirmation that a refund has been processed for Invoice {{invoice_id}} sent on {{invoice_date}}.\nInvoice URL:{{invoice_url}}\nInvoice ID: {{invoice_id}}Invoice Amount: {{invoice_amount}\n}Due Date: {{invoice_due_date}}', 'Yes', 'Yes', 0),
(16, 'Quote:Quote Created', 1, '{{quote_subject}}', 'Greetings,Dear {{contact_name}}, Here is the quote you requested for.  The quote is valid until {{valid_until}}.Quote Unique URL: {{quote_url}}You may view the quote at any time and simply reply to this email with any further questions or requirement.Best Regards,{{business_name}} Team', 'Yes', 'Yes', 0);
